private static ArrayList<UserFeedBackObject> readJsonFromFile(String filePath) {

    try (BufferedReader fileReader = new BufferedReader(new FileReader(filePath))) {
        if( fileReader.readLine() == null)
            return new ArrayList<UserFeedBackObject>();

        Gson gson = new Gson();
        JsonReader reader = new JsonReader(fileReader);

        //ufos = gson.fromJson(reader, new TypeToken<Collection<UserFeedBackObject>>(){}.getType());
        UserFeedBackObject[] ufos = gson.fromJson(reader, UserFeedBackObject[].class);

        // Write the JSON string to the file
        System.out.println("Object saved to file: " + filePath);

        return new ArrayList<UserFeedBackObject>(Arrays.asList(ufos));


    } catch (IOException e) {
        e.printStackTrace();
    }

    return null;
}

